import { Route, Routes } from "react-router-dom";
import GetQr from "./GetQr";
import QRCodeGenerator from "./QRCodeGenerator";
import SlotCreate from "./SlotCreate";

function App() {
  return (
    <Routes>
      <Route path to ="/" element={<QRCodeGenerator/>}/>
      <Route path to ='/get' element={<GetQr/>}/>
      <Route path to ='/create' element={<SlotCreate/>}/>

    </Routes>
  );
}

export default App;
